--
-- Table structure for table `tbl_bom_master`
--

DROP TABLE IF EXISTS `tbl_bom_master`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tbl_bom_master` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `subscriber_id` bigint unsigned NOT NULL,
  `product_id` bigint unsigned NOT NULL,
  `approver_id` bigint unsigned NOT NULL,
  `author_id` bigint unsigned DEFAULT NULL,
  `bom_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` varchar(90) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `revision` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '-',
  `previous_revision` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `BOMfile` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `eau` int DEFAULT NULL COMMENT 'expected annual usage',
  `inventory_date` date DEFAULT NULL,
  `risk_calc_date` date DEFAULT NULL,
  `check_date` date DEFAULT NULL COMMENT 'Keep track of date of last info received',
  `status` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'initiated',
  `manufacturer_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `manufacturer_partnumber` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `category` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `revenue` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `remarks` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `target_date` date DEFAULT NULL,
  `priority` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `request_type` varchar(90) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `work_status_earliest` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `work_status_latest` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `parent_id` bigint unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uq_bom_master` (`subscriber_id`,`bom_name`,`product_id`),
  KEY `tbl_bom_master_product_id_foreign` (`product_id`),
  KEY `subscriber_id` (`subscriber_id`),
  KEY `approver_id` (`approver_id`),
  KEY `author_id` (`author_id`),
  CONSTRAINT `tbl_bom_master_approver_id_foreign` FOREIGN KEY (`approver_id`) REFERENCES `tbl_user` (`id`),
  CONSTRAINT `tbl_bom_master_author_id_foreign` FOREIGN KEY (`author_id`) REFERENCES `tbl_user` (`id`),
  CONSTRAINT `tbl_bom_master_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `tbl_products` (`id`) ON DELETE CASCADE,
  CONSTRAINT `tbl_bom_master_subscriber_id_foreign` FOREIGN KEY (`subscriber_id`) REFERENCES `tbl_subscriber` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `tbl_bom_master`
--

