DROP TABLE IF EXISTS `tbl_component_master`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tbl_component_master` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `manufacturer_name` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `manufacturer_partnumber` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `manufacturer_description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `generic_part_number` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `part_category` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Not Available',
  `component_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Not Available',
  `part_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Not Available',
  `part_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Not Available',
  `stock_position` int DEFAULT NULL,
  `supply_lead_time` double(10,2) DEFAULT NULL,
  `price` double(10,2) DEFAULT NULL,
  `DataSheet` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `notes` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `author_id` bigint unsigned DEFAULT NULL,
  `approver_id` bigint unsigned DEFAULT NULL,
  `component_classification` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT 'Standard',
  `part_mass` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `uom` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `fmd` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `modify` json DEFAULT NULL,
  `assembly_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `power_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `regulatory_test` tinyint(1) NOT NULL DEFAULT '0',
  `year_to_eol` decimal(5,2) DEFAULT NULL,
  `check_date_regulatory` date DEFAULT NULL,
  `check_date_life_cycle` date DEFAULT NULL,
  `check_date_stock` date DEFAULT NULL,
  `check_date_compliance` date DEFAULT NULL,
  `stock_details` json DEFAULT NULL,
  `lead_time_details` json DEFAULT NULL,
  `risk` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `risk_details` json DEFAULT NULL,
  `ltb_possibility` tinyint(1) DEFAULT '0',
  `analysis_status` json DEFAULT NULL,
  `remarks` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uq_namepartnumber` (`manufacturer_partnumber`,`manufacturer_name`),
  KEY `tbl_component_master_author_id_foreign` (`author_id`),
  KEY `tbl_component_master_approver_id_foreign` (`approver_id`),
  FULLTEXT KEY `fulltext_index` (`manufacturer_name`,`manufacturer_partnumber`),
  CONSTRAINT `tbl_component_master_approver_id_foreign` FOREIGN KEY (`approver_id`) REFERENCES `tbl_user` (`id`),
  CONSTRAINT `tbl_component_master_author_id_foreign` FOREIGN KEY (`author_id`) REFERENCES `tbl_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

